import React from "react";
import { useEffect, useState } from "react";

const SideNavbar = ({ setInputType }) => {
  const [typeVal, setType] = useState("about");
  useEffect(() => {
    setInputType(typeVal);
  }, [typeVal]);
  return (
    <div className="flex flex-col gap-4 p-2">
      <div className="cursor-pointer" onClick={setType("about")}>
        About
      </div>
      <div className="cursor-pointer" onClick={setType("education")}>
        Education
      </div>
      <div className="cursor-pointer" onClick={setType("experience")}>
        Experience
      </div>
      <div className="cursor-pointer" onClick={setType("projects")}>
        Projects
      </div>
      <div className="cursor-pointer" onClick={setType("skill")}>
        Skills
      </div>
      <div className="cursor-pointer" onClick={setType("achivement")}>
        Achivement
      </div>
    </div>
  );
};

export default SideNavbar;
